import React, { Component } from 'react';



class Todoitem extends Component {
  render(){
    return(
       <p>
       {this.props.todoit.id} 
       {this.props.todoit.title} 
       {this.props.todoit.desc}
       </p>
      

    );
  }
}

export default Todoitem;
